import React, { useState, useEffect } from 'react';
import CircularText from './CircularText';
import './App.css';

function App() {
  const [scrollY, setScrollY] = useState(0);
  const [showSecondSection, setShowSecondSection] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const currentScrollY = window.scrollY;
      setScrollY(currentScrollY);

      // Show second section when scrolled down 300px or more
      if (currentScrollY > 300) {
        setShowSecondSection(true);
      } else {
        setShowSecondSection(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const professionals = [
    { title: 'Developers', icon: '💻' },
    { title: 'Programmers', icon: '⚡' },
    { title: 'Visionaries', icon: '🌟' },
    { title: 'Designers', icon: '🎨' }
  ];

  const buildingCategories = [
    { title: 'Crypto', icon: '₿', gradient: 'linear-gradient(135deg, #f093fb, #f5576c)' },
    { title: 'AI Agents', icon: '🤖', gradient: 'linear-gradient(135deg, #4facfe, #00f2fe)' },
    { title: 'Clothing Line', icon: '👔', gradient: 'linear-gradient(135deg, #43e97b, #38f9d7)' },
    { title: 'Media Pod', icon: '🎙️', gradient: 'linear-gradient(135deg, #fa709a, #fee140)' },
    { title: 'Health Tech', icon: '🏥', gradient: 'linear-gradient(135deg, #a8edea, #fed6e3)' },
    { title: 'SaaS', icon: '☁️', gradient: 'linear-gradient(135deg, #667eea, #764ba2)' }
  ];

  return (
    <div className="App">
      {/* First Section - Original Hero */}
      <div className="hero-section">
        <div className="container">
          <h1 className="main-title">Buildathon</h1>
          <div className="circular-text-overlay">
            <CircularText
              text=" GENZ 5-9 QUIT CLUB GENZ"
              onHover="speedUp"
              spinDuration={20}
              className="custom-class"
            />
          </div>
        </div>
        <div className="scroll-indicator">
          <div className="scroll-arrow">↓</div>
        </div>
      </div>

      {/* Second Section - Professionals & Building */}
      <div className={`info-section ${showSecondSection ? 'visible' : ''}`}>
        <div className="info-container">
          <div className="section-header">
            <h2 className="section-title">Building the Future</h2>
            <p className="section-subtitle">Where innovation meets ambition</p>
          </div>

          <div className="content-grid">
            {/* For Section */}
            <div className="for-section">
              <h3 className="section-label">For</h3>
              <div className="professionals-grid">
                {professionals.map((prof, index) => (
                  <div key={index} className="professional-card">
                    <div className="prof-icon">{prof.icon}</div>
                    <h4>{prof.title}</h4>
                  </div>
                ))}
              </div>
            </div>

            {/* Building Section */}
            <div className="building-section">
              <h3 className="section-label">Building</h3>
              <div className="building-grid">
                {buildingCategories.map((category, index) => (
                  <div key={index} className="building-card">
                    <div 
                      className="building-icon"
                      style={{ background: category.gradient }}
                    >
                      {category.icon}
                    </div>
                    <h4>{category.title}</h4>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
